#TransferNews
According to Sky Sports(@skysports), FC Schalke 04(@s04)'s Bosnia-Herzegovina full-back Sead Kolašinac(@seadk6) is expected to join Arsenal(@arsenal) on July 1st 2017. Kolašinac's current contract will expire this summer and Arsenal will be bringing him in on a free transfer.

